  <style>
      body { font-family: 'Segoe UI', sans-serif; background-color: #f4f7f6; margin: 0; }
      header { background-color: #2c3e50; color: white; padding: 20px; text-align: center; }
      header h1 { font-size: 1.5rem; margin: 0 0 8px 0; }
      header h2 { font-size: 0.9rem; margin: 0; font-weight: 400; opacity: 0.95; }
      .content-container { padding: 20px; max-width: 1500px; margin: auto; }
      
      /* Map Wrapper - Removed bottom margin to eliminate white space */
      .map-wrapper { 
        height: 500px; 
        border-radius: 8px 8px 0 0; 
        overflow: hidden; 
        margin-bottom: 0; 
        box-shadow: 0 4px 10px rgba(0,0,0,0.1); 
      }
      .map-wrapper .leaflet-container { height: 100% !important; }
      
      /* Filter Controls - Connected to map with 4x2 grid */
      .controls { 
        background: white; 
        padding: 20px; 
        border-radius: 0 0 8px 8px; 
        margin-bottom: 20px; 
        box-shadow: 0 4px 10px rgba(0,0,0,0.1);
        border-top: 1px solid #eee;
      }
      .filter-row { 
        display: grid; 
        grid-template-columns: repeat(4, 1fr); 
        gap: 15px; 
        margin-bottom: 15px; 
      }
      .filter-group label {
        display: block;
        font-size: 12px;
        font-weight: 600;
        color: #495057;
        margin-bottom: 5px;
        text-transform: uppercase;
        letter-spacing: 0.5px;
      }
      .filter-group input, .filter-group select {
        width: 100%;
        padding: 10px;
        border: 1px solid #ddd;
        border-radius: 4px;
        font-size: 14px;
        box-sizing: border-box;
      }
      .filter-group input:focus, .filter-group select:focus {
        outline: none;
        border-color: #3498db;
        box-shadow: 0 0 0 3px rgba(52, 152, 219, 0.1);
      }
      
      .stats { text-align: center; font-size: 14px; color: #666; margin-top: 15px; }
      .stats strong { color: #3498db; font-size: 18px; }
      
      /* Article Cards */
      .article-grid { 
        display: grid; 
        grid-template-columns: repeat(auto-fill, minmax(400px, 1fr)); 
        gap: 20px; 
      }
      .article-card { 
        background: white; 
        border-radius: 12px; 
        padding: 25px; 
        border: 1px solid #eee; 
        transition: all 0.2s; 
        box-shadow: 0 4px 6px rgba(0,0,0,0.03); 
      }
      .article-card:hover { 
        transform: translateY(-3px); 
        box-shadow: 0 8px 15px rgba(0,0,0,0.1); 
        border-color: #3498db; 
      }
      .article-detail { font-size: 13px; margin-bottom: 6px; color: #555; }
      .article-detail strong { color: #333; }
      .tag { 
        display: inline-block;
        background: #e8f5e9; 
        color: #2e7d32;
        padding: 4px 10px; 
        border-radius: 8px; 
        font-size: 11px; 
        margin-right: 6px; 
        margin-top: 8px; 
        font-weight: 600; 
      }
      .tag.tech { background: #fdf2e9; color: #d35400; }
      .doi-link { display: block; margin-top: 12px; font-size: 13px; color: #555; word-break: break-all; }
      .doi-link a { color: #3498db; text-decoration: none; }
      .doi-link a:hover { text-decoration: underline; }
    </style>
</head>

    function populateFilters() {
        const getUnique = (key) => [...new Set(articles.map(a => a[key]))].filter(x => x).sort();
        const getUniqueFlat = (key) => [...new Set(articles.flatMap(a => a[key] ? a[key].toString().split(',').map(t => t.trim()) : []))].filter(x => x).sort();

        const populate = (id, vals) => {
            const sel = document.getElementById(id);
            vals.forEach(v => {
                const opt = document.createElement('option');
                opt.value = v; opt.textContent = v;
                sel.appendChild(opt);
            });
        };

        populate('countryFilter', getUnique('country'));
        populate('techFilter', getUniqueFlat('technology'));
        populate('decisionFilter', getUnique('decision'));
        populate('spatialFilter', getUnique('spatial_status'));
        populate('empiricalFilter', getUniqueFlat('empirical_status'));
        populate('dataTypeFilter', getUniqueFlat('empirical_data_type'));
    }
    
    function filterArticles() {
        const s = (id) => document.getElementById(id).value;
        const searchTerm = s('searchInput').toLowerCase();
        
        const filtered = articles.filter(a => {
            const matchesSearch = !searchTerm || 
                a.title.toLowerCase().includes(searchTerm) || 
                a.authors.toLowerCase().includes(searchTerm) ||
                (a.technology && a.technology.toLowerCase().includes(searchTerm));
            
            const matchesCountry = !s('countryFilter') || a.country === s('countryFilter');
            const matchesTech = !s('techFilter') || (a.technology && a.technology.includes(s('techFilter')));
            const matchesDecision = !s('decisionFilter') || a.decision === s('decisionFilter');
            const matchesPBA = !s('pbaFilter') || a.pba_status === s('pbaFilter');
            const matchesSpatial = !s('spatialFilter') || a.spatial_status === s('spatialFilter');
            const matchesEmpirical = !s('empiricalFilter') || a.empirical_status === s('empiricalFilter');
            const matchesDataType = !s('dataTypeFilter') || (a.empirical_data_type && a.empirical_data_type.includes(s('dataTypeFilter')));
            
            return matchesSearch && matchesCountry && matchesTech && matchesDecision && 
                   matchesPBA && matchesSpatial && matchesEmpirical && matchesDataType;
        });
        displayArticles(filtered);
    }
    
    function displayArticles(data) {
        const grid = document.getElementById('articleGrid');
        document.getElementById('resultCount').textContent = data.length;
        grid.innerHTML = data.length ? '' : '<div style="grid-column: 1/-1; text-align:center; padding:60px; color:#6c757d;">No articles found matching your criteria.</div>';
        
        data.forEach(item => {
            const card = document.createElement('div');
            card.className = 'article-card';
            const techTags = item.technology ? item.technology.split(',').map(t => `<span class='tag tech'>${t.trim()}</span>`).join(' ') : '';
            
            // Format DOI to match marker popup style (full URL)
            const doiDisplay = (item.DOI && item.DOI !== '') ? 
                `<div class='doi-link'>DOI: <a href='${item.DOI.startsWith('http') ? item.DOI : 'https://doi.org/' + item.DOI}' target='_blank'>${item.DOI.startsWith('http') ? item.DOI : 'https://doi.org/' + item.DOI}</a></div>` : '';

            card.innerHTML = `
                <div style='font-size:11px; color:#999; margin-bottom:8px;'>#${item.no}</div>
                <h3 style='font-size:17px; margin:0 0 15px 0; color:#2c3e50; line-height:1.4;'>${item.title}</h3>
                <div class='article-detail'><strong>Authors:</strong> ${item.authors}</div>
                <div class='article-detail'><strong>Year:</strong> ${item.year} | <strong>Journal:</strong> ${item.journal}</div>
                <div class='article-detail'><strong>Decision-making Level Modelled:</strong> ${item.decision}</div>
                <div class='article-detail'><strong>Place-Based Approach (PBA) Status:</strong> ${item.pba_status}</div>
                <div class='article-detail'><strong>Spatial Status:</strong> ${item.spatial_status}</div>
                <div class='article-detail'><strong>Empirical Status:</strong> ${item.empirical_status}</div>
                <div class='article-detail'><strong>Empirical Data Type:</strong> ${item.empirical_data_type}</div>
                <div style='margin-top:12px;'><span class='tag'>${item.country}</span>${techTags}</div>
                ${doiDisplay}
            `;
            grid.appendChild(card);
        });
    }
    
    ['searchInput','countryFilter','techFilter','decisionFilter',
     'pbaFilter','spatialFilter','empiricalFilter','dataTypeFilter'].forEach(id => {
        document.getElementById(id).addEventListener(id === 'searchInput' ? 'input' : 'change', filterArticles);
    });
    
    window.onload = () => { populateFilters(); displayArticles(articles); };
  </script>
